import React from "react";
import { Link } from "react-router-dom";

const MainNav = () => {
  return (
    <React.Fragment>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Link className="" to="/">
          Home
        </Link>

        <Link className="" to="/authors-articles">
          Authors and Articles
        </Link>
      </nav>
    </React.Fragment>
  );
};

export default MainNav;
